window.bookSummaryJSON = "<p>Forced behind enemy lines. Ready to do battle with slavers, spiders, and ghosts.</p> <p>Say hello to the new and improved Clyde Hatchett...who's only a level-four nothing.</p> <p>He's on a (seemingly never-ending) quest to get back to his life in Glaton. And now, all that stands in his way are the Empire-hating Carchedonians, a death cult, and a traitorous party member. Oh, and a mythical city that very probably doesn't exist.</p> <p>Prepare to be blown out of the water on this cutthroat journey through the darkest corners of Vuldranni. Clyde has reached the end of his known world. And that's where the adventure begins.</p>"; 
